import logo from './logo.svg';
import React, { Component } from "react";
import { Route, Link, Switch } from "react-router-dom";
import './App.css';
import UserLogin from './UserLogin';

class App extends Component {
  render(){
  return (
    <div className="App">
      <h1>DelivApp</h1>
      <header className="App-header">

        <nav>
          <Link path='/api/auth/signup/user'>USER</Link>

          <li>
            CARRIER
          </li>
          <li>
            RESTAURANT
          </li>
        </nav>
      </header>
      <main>
      <Route path = '/api/auth/signup/user' component = {<UserLogin/>}/>
      </main>
    </div>
  );
}
}

export default App;
